import React from "react";
import Clients from "../components/ClientWrapper";
import Navbar from "../components/Navbar";
import Footer from "../components/Footer";
const Client = () => {
  return (
    <>
      <Navbar />
      <Clients />
      <Footer />
    </>
  );
};

export default Client;
